import NewList from '../components/NewList'
import List from '../components/List'
import { useState } from 'react'

export default function Index() {

  const [lists, setLists] = useState([])
  const test = [{num: 1}, {num: 2}, {num: 3}]
  return (
    <div
      onClick={ () => console.log(lists)}
    >
      <p>Hello Next.js</p>
      <NewList lists={lists} setLists={setLists}/>
      <div className='targets-container'>
        {lists.map(item => <div className='target'></div>)}
      </div>
      <div className='lists-container'>
        {lists.map(item => <List key={item.key} title={item.title}/>)}
      </div>

      <style jsx>{`
        .target {
          width: 110px;
          height: 100vh;
          border: 1px solid blue;
        }
        .targets-container {
          position: absolute;
          display: flex;
        }
        .lists-container {
          display: grid;
          grid-template-columns: 110px 110px 110px 110px 110px;
        }
      `}</style>
    </div>
  )
}
